import './home.css';
const Home = () => {
  return (
    <div>
        <div className="content">
          <div className="ho">           <h1 className="aceuille">Votre plateforme d’influence au quotidien</h1>
            <p className="actitle">L’influence marketing n’a jamais été aussi simple !</p>
            <p className="acdescription">Démarrez facilement des campagnes d’influence impactantes ! Faites découvrir vos produits et services à des millions de consommateurs ciblés et commencez à générer des ventes.</p>
            </div> 
            <div className="cntimg">
              <img width="1024" height="742" src="https://www.dynamique-mag.com/wp-content/uploads/le-marketing-dinfluence-en-perte-de-vitesse.jpeg"/>
            </div>
          </div>
    </div>
  )
}

export default Home
